import factory from './optionManager.factory.js';
import DefaultTabInnerComponent from '../../../tab/defaulTabInner.js';
import DefaultOptions from './defaultOptions.js';

var getDeps = function getDeps() {
  var globalDefaultOptions = new DefaultOptions(DefaultTabInnerComponent).getOptions();
  return {
    globalDefaultOptions: globalDefaultOptions
  };
};

export default factory.bind(null, getDeps);
